description:
PARTNAIRE LES HERBIERS accompagne une entreprise spécialisée dans la conception de solutions et produits verriers intelligents pour le bien-être, le confort et la sécurité de tous. Présent en amont comme en aval de la filière de production, ils fabriquent et transforment chaque année 100.000 tonnes de verre plat et propose à ses clients une large gamme de produits verriers à haute valeur ajoutée : du verre design ou technique de haute sécurité au vitrage isolant à hautes performances énergétiques et environnementales, à destination des secteurs du bâtiment, du transport et d'autres industries.

En tant qu'Agent de production - coupeur, vous réaliserez les coupes afin d'approvisionner en verres la ligne d'assemblage DV, le façonnage ou le service expédition.
Contrat à pourvoir en intérim dans un premier temps. 

- Assurer l'entretien et la programmation de la machine ;
- Nettoyer la machine ;
- Conduire manuellement ou de façon automatique les machines FLOAT, FEUILLETE, MIXTE ;
- Vérifier la coupe et l'application des instructions de contrôle ;
- Assurer le rangement des verres conformément aux instructions de travail ;
- Assurer le repérage des lots de production sur les agrès d'atelier ;
- Appliquer les consignes de sécurité.

Vous travaillez en horaire décalés du Lundi au Jeudi - 5h-13h/13h-21h et le Vendredi 7h-12h-12h/19h Vous avez idéalement acquis une première expérience sur un poste similaire qui vous a permis de développer des connaissances sur les différents équipements de production, une maitrise des gestes techniques et une rigueur dans l'exécution ;
Vous faites preuve d'une aptitude à vous conformer aux objectifs de la production ;
Vous disposez de capacités pour travailler en équipe et communiquer ;       
Vous êtes rigoureux(se), organisé(e) ;
Vous êtes doté(e) d'une adaptabilité et d'une capacité d'écoute et d'analyse.

Taux horaire 11.78EUR/heure + primes d'équipe et panier


Mes avantages :

- Une mutuelle santé / une prévoyance
- Un CET, compte épargne temps qui rémunère votre épargne à 5%
- Des indemnités de fin de mission à hauteur de 10%
- Des chèques cadeaux parrainage jusqu'à 100 euros
- Un comité d'entreprise dès le premier mois de mission

Aquila RH Cherbourg, agence de recrutement Intérim, CDD et CDI, recherche un Ouvrier paysagiste (H/F).

Nos avantages :
- vous bénéficiez de notre comité d'entreprise en ligne COULEUR CE (abonnements sportifs, culturels; promos et bons plans; réductions groupées; parcs loisirs et attractions...) ;
- vous bénéficiez des avantages du FASTT ;
- vous bénéficiez de notre programme MyBonus ;
- parrainage d'un filleul, recevez un cadeau dès qu'il ou elle aura effectué 10 jours de mission ;
- vous vous engagez avec nous sur le long terme, Aquila RH s'occupe de votre mutuelle ;
- vous pouvez avoir accès à des formations pour favoriser votre montée en compétence ;
- rémunération selon profil et grilles en vigueur dans la convention collective du bâtiment + 10% IFM + 10% ICP ;
- 2 acomptes possibles chaque semaine ;
- les heures supplémentaires sont payées à la semaine.



Vos missions:
- Aménager et entretenir les espaces verts
- Réaliser des aménagements paysagers (clôtures, plantations..)
- Maintenir et entretenir les équipements et outils de jardinage 

Votre profil:
Niveau d'études: CAP / BEP

Nous recherchons une personnes dynamique et possédant une première expérience dans les espaces verts.


Vous avez une première expérience sur un poste similaire.
Des connaissances en maçonnerie sont un plus à votre candidature.
Les équipements et outils de jardinage n'ont aucun secret pour vous.

Lynx RH Toulouse Est, cabinet de recrutement en CDI, CDD, Intérim, recherche pour l'un de ses clients, acteur majeur dans les services financiers, un Commercial H/F pour un poste en CDI basé sur Toulouse (31).


Vos missions:
- Prospecter et développer un portefeuille clients en ciblant majoritairement les collectivités, les entreprises, les start-up;

- Identifier les contacts décisionnaires;

- Comprendre les besoins de vos clients et leur apporter une solution globale sur mesure;

- Développer une relation de confiance avec vos clients et s'assurer de leur satisfaction en vue de les fidéliser;

- Suivre l'activité de votre portefeuille à travers l'outil CRM Votre profil:
Niveau d'études: Bac +3

Vous possédez un bon relationnel client et vous êtes à l'aise avec la prospection téléphonique.

Pas de déplacements à prévoir

Rémunération fixe + variable + véhicule de fonction
